<html><title>Coristanco</title><body>&#10;<p> &#10;<a href="http://en.wikipedia.org/wiki/Ficheiro:Situacion_Coristanco.PNG%7Cthumb" id="w">Localiza&ccedil;&atilde;o de Coristanco</a>&#10; &#10;<b>Coristanco</b> &eacute; um <a href="http://en.wikipedia.org/wiki/Lista_de_munic%C3%ADpios_da_Espanha" id="w">munic&iacute;pio</a> da <a href="http://en.wikipedia.org/wiki/Galiza" id="w">Galiza</a> na <a href="http://en.wikipedia.org/wiki/Prov%C3%ADncias_da_Espanha" id="w">prov&iacute;ncia</a> &#10;da <a href="http://en.wikipedia.org/wiki/Prov%C3%ADncia_da_Corunha" id="w">Corunha</a>, de &aacute;rea 140 <a href="http://en.wikipedia.org/wiki/Quil%C3%B3metro_quadrado" id="w">km&sup2;</a> com &#10;popula&ccedil;&atilde;o de 7765 habitantes (<a href="http://en.wikipedia.org/wiki/2004" id="w">2004</a>) e <a href="http://en.wikipedia.org/wiki/Densidade_populacional" id="w">densidade populacional</a> de 54,77 hab/km&sup2;.<sup id="_ref&shy;1" class="reference"><a href="#_note&shy;1" title="">[1]</a></sup>&#10;<a class="externallink" href="http://www.coristanco.net/" rel="nofollow" title="http://www.coristanco.net/">http://www.coristanco.net/</a>&#10;</p><a id="Demografia" name="Demografia"></a><h2> Demografia </h2>&#10;<p> </p>&#10;<p> </p>&#10;<p> &#10; </p>&#10;<p> </p>&#10;<p><a href="http://en.wikipedia.org/wiki/Categoria:Munic%C3%ADpios_da_prov%C3%ADncia_da_Corunha" id="w">Coristanco</a></p></body></html>
